import Stats from "../components/Stats.js"
import CountrySelector from "../components/CountrySelector.js"


export default function IndexPage() {
    return (
        <div>
            <h1>Covid-19 Tracker</h1>
            <h4>Global Cases</h4>
            <Stats></Stats>
            <CountrySelector></CountrySelector>
        </div>
    )
}
